import React, { useState } from "react";
import "tailwindcss/tailwind.css";

const App = () => {
  const [activeTab, setActiveTab] = useState("Dashboard");

  return (
    <div className="min-h-screen flex flex-col">
      {/* Header */}
      <header className="bg-blue-500 text-white p-4">
        <h1 className="text-2xl">My React App</h1>
      </header>

      <div className="flex flex-1">
        {/* Sidebar */}
        <aside className="bg-gray-800 text-white w-1/4 p-4">
          <nav>
            <ul>
              <li
                className={`cursor-pointer p-2 ${
                  activeTab === "Dashboard" ? "bg-blue-600" : ""
                }`}
                onClick={() => setActiveTab("Dashboard")}
              >
                Dashboard
              </li>
              <li
                className={`cursor-pointer p-2 ${
                  activeTab === "Page 1" ? "bg-blue-600" : ""
                }`}
                onClick={() => setActiveTab("Page 1")}
              >
                Page 1
              </li>
            </ul>
          </nav>
        </aside>

        {/* Main Content */}
        <main className="flex-1 p-4">
          {activeTab === "Dashboard" && (
            <div>
              <h2 className="text-xl">Welcome to the Dashboard</h2>
            </div>
          )}

          {activeTab === "Page 1" && (
            <div>
              <h2 className="text-xl mb-4">Page 1</h2>
              <table className="min-w-full bg-white border border-gray-300">
                <thead>
                  <tr>
                    <th className="py-2 px-4 border-b">ID</th>
                    <th className="py-2 px-4 border-b">Name</th>
                    <th className="py-2 px-4 border-b">Email</th>
                  </tr>
                </thead>
                <tbody>
                  {Array.from({ length: 10 }, (_, index) => (
                    <tr key={index}>
                      <td className="py-2 px-4 border-b">{index + 1}</td>
                      <td className="py-2 px-4 border-b">Name {index + 1}</td>
                      <td className="py-2 px-4 border-b">
                        email{index + 1}@example.com
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          )}
        </main>
      </div>
    </div>
  );
};

export default App;
